    override suspend fun importArmyPainterFanatic() {
        withContext(Dispatchers.IO) {
            val armyPainterFanaticImportData =
                Gson().fromJson(warpaints, ArmyPainterFanaticImportData::class.java)
            armyPainterFanaticImportData.data.forEach { paint ->
                paintsRepository.insertPaint(
                    MiniaturePaintDetails(name = paint.Name, hexColor = paint.ColorHexCode, type = paint.PaintType, saveState = SaveStateEnum.SAVED, manufacturer = "The Army Painter").toPaint()
                )
            }
        }
    }
